            "description": {
                "text": "Northcoders Showcase\r\nMeet our graduates and Hire In-Demand Junior Developer talent*\r\n\r\nYou have been invited to watch our new graduates showcase their work\r\ncreated during their time with us. You will have the opportunity to meet\r\nthe students and understand how they could fit within your team.\r\nDrinks and Refreshments are provided. Places are limited.\r\nSecure your slot at\r\nwww.northcoders.com/student-showcase\r\nYou have been invited to watch our new graduates showcase their work created during their time with us. You will have the opportunity to meet the students and understand how they could fit within your team.\r\nRead more about what our students do during graduation here.\r\nDrinks and snacks will be provided.\r\nWe hope to see you there!\r\n*If you do not have an existing Agreement with Northcoders to hire Northcoders Graduates, by completing Eventbrite’s booking process for our event on 9 November, you confirm that you agree to be bound by our Graduate Hiring Terms and Conditions as if each of our recent graduates showcased at the event were an ‘Applicant’ for the purposes of those terms.  The terms provide for the payment of an ‘Introduction Fee’ if you employee an Applicant and a copy of them is available on request to partners@northcoders.com ",
                "html": "<P STYLE=\"text-align: center;\"><SPAN STYLE=\"font-size: xx-large;\"><STRONG><SPAN STYLE=\"font-family: helvetica;\">Northcoders Showcase</SPAN></STRONG></SPAN></P>\r\n<P STYLE=\"text-align: center;\"><SPAN STYLE=\"font-size: large;\"><STRONG><SPAN STYLE=\"font-family: helvetica;\">Meet our graduates and Hire In-Demand Junior Developer talent*</SPAN></STRONG></SPAN></P>\r\n<P><IMG STYLE=\"display: block; margin-left: auto; margin-right: auto;\" TITLE=\"Cohort\" ALT=\"\" HEIGHT=\"486\" WIDTH=\"486\" SRC=\"https://s.evbuc.com/https_proxy?url=http%3A%2F%2Fres.cloudinary.com%2Fhttp-northcoders-com%2Fimage%2Fupload%2Fv1507117694%2Fimage_55_fssvno.jpg&sig=ADR2i7918mSbHzpfsw_y4EejEvqRC59Lzw\"><BR></P>\r\n<DIV STYLE=\"color: transparent; position: absolute; white-space: pre; cursor: text; transform-origin: 0px 0px 0px; left: 63.7796px; top: 313.732px; font-size: 15px; font-family: sans-serif; transform: scaleX(1.07841);\" DATA-CANVAS-WIDTH=\"517.3515000000001\">You have been invited to watch our new graduates showcase their work</DIV>\r\n<DIV STYLE=\"color: transparent; position: absolute; white-space: pre; cursor: text; transform-origin: 0px 0px 0px; left: 63.7796px; top: 334.732px; font-size: 15px; font-family: sans-serif; transform: scaleX(1.09851);\" DATA-CANVAS-WIDTH=\"511.3964999999999\">created during their time with us. You will have the opportunity to meet</DIV>\r\n<DIV STYLE=\"color: transparent; position: absolute; white-space: pre; cursor: text; transform-origin: 0px 0px 0px; left: 63.7796px; top: 355.732px; font-size: 15px; font-family: sans-serif; transform: scaleX(1.09408);\" DATA-CANVAS-WIDTH=\"468\">the students and understand how they could fit within your team.</DIV>\r\n<DIV STYLE=\"color: transparent; position: absolute; white-space: pre; cursor: text; transform-origin: 0px 0px 0px; left: 63.7796px; top: 397.387px; font-size: 15px; font-family: sans-serif; transform: scaleX(1.0897);\" DATA-CANVAS-WIDTH=\"422.44649999999996\">Drinks and Refreshments are provided. Places are limited.</DIV>\r\n<DIV STYLE=\"color: transparent; position: absolute; white-space: pre; cursor: text; transform-origin: 0px 0px 0px; left: 63.7796px; top: 418.387px; font-size: 15px; font-family: sans-serif; transform: scaleX(1.09662);\" DATA-CANVAS-WIDTH=\"137.145\">Secure your slot at</DIV>\r\n<DIV STYLE=\"color: transparent; position: absolute; white-space: pre; cursor: text; transform-origin: 0px 0px 0px; left: 205.125px; top: 418.387px; font-size: 15px; font-family: sans-serif; transform: scaleX(1.11434);\" DATA-CANVAS-WIDTH=\"303.79499999999996\">www.northcoders.com/student-showcase</DIV>\r\n<P STYLE=\"text-align: center;\">You have been invited to watch our new graduates showcase their work created during their time with us. You will have the opportunity to meet the students and understand how they could fit within your team.<BR></P>\r\n<P STYLE=\"text-align: center;\"><SPAN STYLE=\"color: #c1002e;\"><STRONG>Read more about what our students do during graduation <A HREF=\"http://blog.northcoders.com/what-do-students-do-during-project-phase-at-northcoders\" REL=\"nofollow\"><SPAN STYLE=\"color: #c1002e;\">here</SPAN></A>.</STRONG></SPAN></P>\r\n<P STYLE=\"text-align: center;\">Drinks and snacks will be provided.</P>\r\n<P STYLE=\"text-align: center;\">We hope to see you there!</P>\r\n<P STYLE=\"text-align: left;\"><SPAN STYLE=\"color: windowtext;\">*If you do not have an existing Agreement with Northcoders to hire Northcoders Graduates, by completing Eventbrite’s booking process for our event on 9 November, you confirm that you agree to be bound by our Graduate Hiring Terms and Conditions as if each of our recent graduates showcased at the event were an ‘Applicant’ for the purposes of those terms.  The terms provide for the payment of an ‘Introduction Fee’ if you employee an Applicant and a copy of them is available on request to partners@northcoders.com </SPAN></P>"
            },
