            "name": {
                "text": "Bootcamp Interview Prep",
                "html": "Bootcamp Interview Prep"
            },
            "description": {
                "text": "\nDevelop your JavaScript Skills!\n\n\n\nOur free Interview Prep Sessions are designed to help you to prepare for the Northcoders interview and gain confidence with your code. You will have already worked through our recommended Codecademy track or completed our Introduction to Programming course and want to start solving challenges and developing your knowledge of JavaScript.\nThe session will feature a short introductory lecture before setting some challenges for you to solve, supported by the Northcoders tutors who offer expert advice and guidence.\nPlease bring your own laptop.\n\n\n\n",
                "html": "<H3 CLASS=\"label-primary\"><BR></H3>\n<H2 CLASS=\"label-primary\">Develop your JavaScript Skills!</H2>\n<DIV CLASS=\"has-user-generated-content js-d-read-more read-more js-read-more read-more--medium-down read-more--expanded\">\n<DIV CLASS=\"js-xd-read-more-toggle-view read-more__toggle-view\">\n<DIV CLASS=\"js-xd-read-more-contents l-mar-top-3\">\n<P>Our free Interview Prep Sessions are designed to help you to prepare for the Northcoders interview and gain confidence with your code. You will have already worked through our recommended <A HREF=\"https://www.codecademy.com/learn/introduction-to-javascript\" TARGET=\"_blank\" TITLE=\"Learn to Code with codeacademy\" REL=\"nofollow noopener noreferrer\">Codecademy track</A> or completed our <A HREF=\"https://northcoders.com/introduction\" TARGET=\"_blank\" TITLE=\"Introduction to Programming course\" REL=\"nofollow noopener noreferrer\">Introduction to Programming course</A> and want to start solving challenges and developing your knowledge of JavaScript.</P>\n<P>The session will feature a short introductory lecture before setting some challenges for you to solve, supported by the Northcoders tutors who offer expert advice and guidence.</P>\n<P>Please bring your own laptop.</P>\n<P><IMG ALT=\"Northcoders Tutor working with a student\" SRC=\"https://cdn.evbuc.com/eventlogos/162841237/learntocodemanchester.jpg\"></P>\n</DIV>\n</DIV>\n</DIV>"
            },
